  `is_team` tinyint(3) unsigned DEFAULT 0 COMMENT '是否团队项目',
  `type` varchar(50) DEFAULT '' COMMENT '类别 TYPE ',
  `status` tinyint(4) NOT NULL,
  `score` int(4) unsigned NOT NULL DEFAULT 0 COMMENT '项目分数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=237 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;

