-- ----------------------------
--  Table structure for `yunzhi_task`
-- ----------------------------
DROP TABLE IF EXISTS `yunzhi_task`;
CREATE TABLE `yunzhi_task` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned DEFAULT 0 COMMENT '用户ID',
  `cycle_id` int(10) unsigned DEFAULT 0 COMMENT '周期ID',
  `value` int(10) unsigned DEFAULT 0 COMMENT '任务量',
  `type` varchar(50) DEFAULT '' COMMENT '类型：基础教学、基础科研、岗位科研、岗位服务育人',
  `time` int(10) unsigned DEFAULT 0 COMMENT '更新添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `yunzhi_user`
-- ----------------------------
DROP TABLE IF EXISTS `yunzhi_user`;
CREATE TABLE `yunzhi_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '教工id',
  `username` varchar(100) NOT NULL COMMENT '用户名',
  `password` varchar(100) NOT NULL DEFAULT 'abc123456' COMMENT '用户登陆密码',
  `name` varchar(100) NOT NULL COMMENT '教工姓名',
  `email` varchar(100) NOT NULL COMMENT '教工邮箱，用来重置密码',
  `state` int(2) unsigned NOT NULL DEFAULT 1 COMMENT '用户状态，1表示正常，0表示禁用',
  `phone` varchar(100) NOT NULL DEFAULT '0' COMMENT '电话号码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=119 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

