-- ----------------------------
--  Table structure for `yunzhi_workflow_log`
-- ----------------------------
DROP TABLE IF EXISTS `yunzhi_workflow_log`;
CREATE TABLE `yunzhi_workflow_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pre_id` int(10) unsigned DEFAULT 0 COMMENT '上一节LOG节点ID',
  `workflow_id` int(10) unsigned DEFAULT NULL,
  `user_id` int(10) unsigned DEFAULT NULL COMMENT '用户ID',
  `commit` varchar(500) DEFAULT '' COMMENT '审核意见',
  `time` int(10) unsigned DEFAULT 0 COMMENT '提交时间',
  `is_commited` tinyint(3) unsigned DEFAULT 0 COMMENT '是否提交,0未提交,1提交.提交则是完成.',
  `is_clicked` tinyint(4) DEFAULT 0 COMMENT '是否已点击(未点击,待办,点击:在办)',
  `is_shelved` tinyint(3) unsigned DEFAULT 0 COMMENT '是否被搁置0未搁置，1搁置',
  PRIMARY KEY (`id`),
  KEY `is_finished` (`is_clicked`)
) ENGINE=InnoDB AUTO_INCREMENT=2797 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='用户审核日志表，记录审核人，审核时间，审核内容,以及最终此条信息是否已经审核完毕（未审核完毕，为：在办，已审核完毕：为“已办”）。';

